import React, { Component } from "react";
import { Link, animateScroll as scroll } from "react-scroll";
import logo from "./assets/logo.svg";
import './navbar.css';

export default class Navbar extends Component {
    scrollToTop = () => {
        scroll.scrollToTop();
    };
  render() {
    return (
      <nav className="nav" id="navbar">
        <div className="nav-content">
          <img
            src={logo}
            className="nav-logo"
            alt="Logo"
            onClick={this.scrollToTop}
          />
          <ul className="nav-items">
            <li className="nav-item" onClick={this.scrollToTop} >Section 1</li>
            <li className="nav-item">Section 2</li>
            <li className="nav-item">Section 3</li>
            <li className="nav-item">Section 4</li>
            <li className="nav-item">Section 5</li>
          </ul>
          <Link
            activeClass="active"
            to="section1"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500}
        ></Link>
        <ul className="networks">
          <li>
            <a>
              <img src="" alt="facebook"></img>
            </a>
          </li>
        </ul>
        </div>
      </nav>
    );
  }
}
